// src/ComparisonPage.js
import React from 'react';
import './HomePage.css';

const ComparisonPage = () => {
  return (
    <div className="comparisonpage">
      <nav>
        <div id="nav-links">
            <a href="{{ url_for('home') }}">About Us</a>
            <a href="{{ url_for('comparison') }}">Comparison Tool</a>
        </div>
        <span>Project Title</span>
      </nav>
      <div id="title">
          <div id="page-title">Feed Comparison Tool</div>
          <p>Select two feeds to compare from the categories below:</p>
          <div id="category-buttons">
              <div class="category-button button" id="general">General</div>
              <div class="category-button button" id="sports">Sports</div>
              <div class="category-button button" id="news">News</div>
              <div class="category-button button" id="entertainment">Entertainment</div>
          </div>
      </div> 
    </div>
  );
}

export default ComparisonPage;
